var UIComponent = class {
  emitter = new EventEmitter();
  view;
  value;
  id;
  constructor(id) {
    this.id = id;
  }
  apply(role, theme) {
    if (!this.view)
      return;
    Java.scheduleOnMainThread(() => applyStyle(this.view, role, theme));
  }
  getView() {
    return this.view;
  }
  getValue() {
    return this.value;
  }
  getId() {
    return this.id;
  }
  setValue(value) {
    this.value = value;
    this.updateView();
  }
  on(event, listener) {
    this.emitter.on(event, listener);
  }
  off(event, listener) {
    this.emitter.off(event, listener);
  }
  emit(event, ...args) {
    this.emitter.emit(event, ...args);
  }
  init(context) {
    this.createView(context);
  }
  attach() {
  }
  detach() {
  }
};

